import React from "react";
import Icon1 from '../../images/svg-1.png';
import { TeamCard, TeamContainer, TeamH1, TeamH2, TeamIcon, TeamP, TeamWrapper } from "./TeamElements";


export const Team = () => {
  return (
    <TeamContainer id="team">
      <TeamH1>Nasz sk≈Çad</TeamH1>
      <TeamWrapper>
        <TeamCard>
          <TeamIcon src={Icon1} />
          <TeamH2>Reduce expenses</TeamH2>
          <TeamP>We help reduce your fess.</TeamP>
        </TeamCard>
        <TeamCard>
          <TeamIcon src={Icon1} />
          <TeamH2>Virtual Offices</TeamH2>
          <TeamP>We help reduce your fess.</TeamP>
        </TeamCard>
        <TeamCard>
          <TeamIcon src={Icon1} />
          <TeamH2>Premium Benefits</TeamH2>
          <TeamP>We help reduce your fess.</TeamP>
        </TeamCard>
      </TeamWrapper>
    </TeamContainer>
  );
};
